import React from "react";
import {
  Grid,
  Card,
  CardActions,
  CardContent,
  CardMedia,
  Button,
} from "@material-ui/core";

export default function Course(props) {
  return (
    <div>
      <Grid container>
        <Card>
          <CardMedia
            style={{ paddingTop: "56.25%" }}
            image="https://source.unsplash.com/random"
          />
          <CardContent>
            {props.articles.title[0]}
            {props.articles.abstract[0]}
          </CardContent>
          <CardActions>
            <Button variant={"contained"} size="small" color="primary">
              Go To The Article
            </Button>
          </CardActions>
        </Card>
      </Grid>
    </div>
  );
}
